import React from 'react';
import FB from 'fb';
import axios from 'axios';

class User extends React.Component {
    constructor() {
        super();

        this.onSubmit = this.onSubmit.bind(this);
    }

    onSubmit() {
        axios.get("http://localhost:8080/user");
    }

    render() {
        return (
            <div>
                <form onSubmit={this.onSubmit}>
                    <button>
                        Request
                    </button>
                </form>
            </div>
        );
    }
}

export default User;
